INSERT INTO `post` VALUES (1,1,'Начало работы издательства и выход первой книги','Теперь \"Капибара\" и в интернете','2022-07-01 22:20:00','Мы очень рады сообщить, что отныне у нашего издательского дома \"Капибара\" есть интернет-ресурс, в котором можно увидеть полный каталог наших книг и выбрать те, которые вы хотите приобрести. Также сообщаем, что в нашем интернет-каталоге уже доступна книга \"Зов Ктулху\" от отца ужасов Говарда Филлипса Лавкрафта.'),(2,2,'Появление цикла историй про Гарри Поттера в нашем издательстве','Теперь Гарри Поттер с нами','2022-07-02 15:30:00','Дорогие друзья, хотим обрадовать вас тем, что теперь вы можете приобрести у нас все книги про мальчика, который выжил.'),(3,13,'Теперь в наличии вся коллекция Толкина','Прикоснёмся к Средиземью вместе','2022-07-03 16:30:00','Друзья, рады сообщить, что в нашем каталоге появились все книги профессора Толкина, теперь вы сможете насладиться миром Средиземья в нашем издании.');
/*!40000 ALTER TABLE `post` ENABLE KEYS */;
UNLOCK TABLES;

